"222806":{"id":"222806","name":"Lambert vs. Lambert: Só por Cima de seu Cadáver","slug":"lambert-vs-lambert-so-por-cima-de-seu-cadaver","original_title":"Lambert contre Lambert : au nom de Vincent","overview":"​Em 11 de julho de 2019, Vincent Lambert faleceu no Hospital de Reims. Esta é a parte final de mais de uma década de uma saga familiar, médica, jurídica, política e midiática que durou até a véspera de sua morte. Como será que os problemas enfrentados por este jovem mudaram tão drasticamente a forma como a sociedade enxerga a vida e a morte?","first_air_date":"2023-05-10","episode_run_time":0,"vote_average":8.7,"number_of_seasons":1,"number_of_episodes":4,"created_by":["Elodie Buzuel"],"production_companies":["Zadig Productions"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/fqpri1ZlmlUXLUp0SGk1QKPFQU0.jpg","poster_path":"https://image.tmdb.org/t/p/original/4rx8iiH86SCRkOFA68LcHzM1jCV.jpg","cast":[],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/4rx8iiH86SCRkOFA68LcHzM1jCV.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/4rx8iiH86SCRkOFA68LcHzM1jCV.jpg","air_date":"2023-05-10","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Família Destruída","overview":"Vincent Lambert, o enfermeiro de 32 anos que gostava de ir a festas e tinha uma filha de dois meses, se envolveu em um grave acidente de carro. As lesões o deixaram entre a vida e a morte. Seus entes queridos tentam de tudo para acordá-lo, mas os pretextos de solidariedade cessaram e os parentes retomaram suas vidas. Feridas do passado ressurgem.","air_date":"2023-05-10","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/iYwRpg9uOAilzqtfYQ4wzfqwB4r.jpg","vote_average":0},"2":{"name":"Briga Familiar nos Tribunais","overview":"Um médico decide interromper a alimentação de Vincent, e a família dele entra em uma batalha legal armados com os advogados mais implacáveis. Incapazes de resolver a situação, os tribunais encaminham o caso para as instâncias superiores. As leis sobre a ortotanásia podem mudar, e isso pode afetar outras 1.700 pessoas com lesões cerebrais graves.","air_date":"2023-05-10","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/5Z9FHQgr7nN3HasF9kt1E4LFfMP.jpg","vote_average":0},"3":{"name":"Perdendo o Controle","overview":"Em manifestações de rua e nas redes sociais, o caso de Vincent gera comoção. Sob pressão e recebendo ameaças de morte, o médico de Vincent pede demissão. O nome de Vincent é usado de formas extremas em um esforço para mudar a lei. Os familiares de Vincent se desentendem, a situação toma novas proporções e a família perde o controle.","air_date":"2023-05-10","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/rjwYzSLnIgiP5HwfcoGQI7AGcpo.jpg","vote_average":0},"4":{"name":"O Ato Final","overview":"Onze anos após o acidente de Vincent, sua esposa, Rachel, e sua mãe, Viviane, movidas respectivamente por seus votos e suas convicções, lutam até o fim, usando toda a sua coragem. Vincent Lambert é “desligado” pela terceira e última vez, e uma França dividida praticamente assiste à morte ao vivo.","air_date":"2023-05-10","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/3XRpZFo57mfZ8NKMqJNIF0lbO8.jpg","vote_average":0}}}}},
