"112783":{"id":"112783","name":"Os Segredos do Zoológico: Carolina do Norte","slug":"os-segredos-do-zoologico-carolina-do-norte","original_title":"Secrets of the Zoo: North Carolina","overview":"No zoológico da Carolina do Norte, uma família apaixonada de veterinários e tratadores cuida de mais de 1.000 animais em um dos maiores zoológicos do mundo.","first_air_date":"2020-10-31","episode_run_time":45,"vote_average":4,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Double Act Productions","Remedy Television + Branded"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/1VHZxfO9YMEj10kN5blCfraQ7xx.jpg","poster_path":"https://image.tmdb.org/t/p/original/qeZQuVn7wkK8tL0gTzqF9veJ22l.jpg","cast":["Jb Minter"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qeZQuVn7wkK8tL0gTzqF9veJ22l.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qeZQuVn7wkK8tL0gTzqF9veJ22l.jpg","air_date":"2020-10-31","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Tal Pai, Tal Filho","overview":"Os tratadores se preparam para o nascimento de um chimpanzé, os veterinários investigam a misteriosa doença de um urso e um antílope perigoso toma um tiro de tranquilizante no habitat das pastagens do zoológico.","air_date":"2020-10-31","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/sSzkYt2SIPfc6Q5xP0mddGWuSr6.jpg","vote_average":0},"2":{"name":"Dr. Zoo-Little","overview":"No zoológico da Carolina do Norte, um gorila faz uma cirurgia odontológica de emergência, os veterinários examinam uma cascavel mortal e os tratadores tentam tirar sangue da cauda de um leão.","air_date":"2020-11-07","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/p9KJqS8wfwfT7JUp7NeJkU5QZSi.jpg","vote_average":0},"3":{"name":"Sr. e Sra. Serpente","overview":"Os tratadores se preparam para o nascimento de um rinoceronte branco; dois jovens leões deixam o bando; e um par de cobras canibais vão a alguns encontros arriscados.","air_date":"2020-11-14","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/ra0r6PN7wl1sOA9uPeWEOLNgUJs.jpg","vote_average":0},"4":{"name":"Os Opostos se Atraem","overview":"O zoológico espera a gravidez de urso polar; dois lobos vermelhos ameaçados de extinção vão a um encontro às cegas; e um jovem elefante recebe um tratamento incomum.","air_date":"2020-11-21","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/hUz82nkb9mlij685KvqnrRi4gku.jpg","vote_average":0},"5":{"name":"Parque das Girafas","overview":"O zoológico acolhe uma nova girafa tímida para o rebanho; uma morcego grávida se prepara para dar à luz; e tratadores dedicados dão a um chimpanzé epiléptico uma vida melhor.","air_date":"2020-11-28","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/jWsWWG9iyLlMVOnTxSqPnzZJbpM.jpg","vote_average":0},"6":{"name":"Fala Demais, Faz de Menos","overview":"Os veterinários do zoológico estão abarrotados de serviço! Um crocodilo enorme precisa de uma coleta de sangue; uma leoa feroz precisa remover um dente; e pais papagaios-do-mar esperam que seus ovos eclodam.","air_date":"2020-12-05","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/bIRuwNV5MIUEb8jDppj7SxDSdFb.jpg","vote_average":0},"7":{"name":"Falando em Confusão","overview":"Os tratadores aguardam o tão esperado filhote de gato-da-areia; um filhote de papagaio-do-mar nervoso aprende a nadar; e filhotes de urso preto resgatados se preparam para a vida fora do zoológico.","air_date":"2020-12-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/5750Eg90r3flN6bk3L4b7bkqAOk.jpg","vote_average":0},"8":{"name":"Ficando Sem Tempo","overview":"Veterinários do zoológico tratam de sete pítons; os filhotes de lontras órfãos vão aprender a pescar; e os tratadores correm para ajudar raposas árticas com ferimentos misteriosos.","air_date":"2020-12-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/jFM7Rr2dwd9GLFXpFxsCpNBESJL.jpg","vote_average":0}}}}},
