"132376":{"id":"132376","name":"Tudo ou Nada: Arsenal","slug":"tudo-ou-nada-arsenal","original_title":"All or Nothing: Arsenal","overview":"Tudo ou Nada: Arsenal acompanha o icônico clube de futebol durante uma temporada inesquecível. Com acesso sem precedentes e capturando os altos e baixos da vida dentro e fora do campo, este é o melhor do futebol: intenso, dramático e cheio de paixão.","first_air_date":"2022-08-04","episode_run_time":49,"vote_average":8,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["72 Films","Amazon Studios"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/2PCI1WbzVTIjRp1xWuBede9Bawm.jpg","poster_path":"https://image.tmdb.org/t/p/original/4LztV8nZYJy30BVVpI1IwMhX8Dd.jpg","cast":["Daniel Kaluuya","Mikel Arteta","Pierre-Emerick Aubameyang","Granit Xhaka","Folarin Balogun"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/pPWPsbW1cP7TdPP8O5NGC8fOSgf.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/pPWPsbW1cP7TdPP8O5NGC8fOSgf.jpg","air_date":"2022-08-04","episode_count":8,"overview":"N/A","vote_average":8.9,"episodes":{"1":{"name":"UM NOVO COMEÇO","overview":"É o início de uma temporada crucial para o Arsenal Football Club, e a pressão está aumentando sobre o técnico Mikel Arteta para colocar o clube de volta no top 4 da Premier League. Apesar de uma série de novas contratações durante o verão, a equipe sofre três derrotas seguidas, deixando-os na parte inferior da tabela. As expectativas são altas quando a equipe enfrenta o Norwich City no Emirates.","air_date":"2022-08-04","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/qPsori5C9nuhZrg3MGHYLMPsYIl.jpg","vote_average":8.833},"2":{"name":"O NORTH LONDON DERBY","overview":"É o North London Derby - um dos maiores clássicos do mundo. Arteta e sua jovem equipe se preparam para enfrentar o rival Tottenham Hotspur diante de uma torcida agitada no Emirates Stadium. A pressão aumenta sobre o herói da Euro 2020, Bukaya Saka, para marcar seu primeiro gol da temporada. Para o capitão Pierre-Emerick Aubameyang, este jogo é muito mais do que apenas uma rivalidade entre equipes.","air_date":"2022-08-04","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/14R2CNqGqiN9SvyDtdAvBCXTrT7.jpg","vote_average":8.7},"3":{"name":"CONTINUE NO JOGO","overview":"Dois meses depois, e em uma sequência de vitórias convincentes e enfáticas, a equipe se prepara para um jogo difícil fora de casa. O goleiro Aaron Ramsdale ganha confiança, dando nova força à defesa da equipe. O lateral Kieran Tierney sofre uma contusão, enquanto o novo reforço Nuno Tavares brilha na sua estreia, mas, quando o time vai para Anfield, uma sequência de 10 vitórias está em jogo.","air_date":"2022-08-04","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/ll68eOBTAydt1yPzyIhRcwPMyq.jpg","vote_average":8.7},"4":{"name":"RESPEITO, COMPROMISSO, PAIXÃO","overview":"As especulações aumentam quando o favorito da torcida, Aubameyang, deixa de ser capitão. Ele para de treinar com os titulares, e o foco muda para os outros jogadores, incluindo o brasileiro Gabriel Martinelli. Com o Natal se aproximando, e a covid causando o caos na liga, Mikel Arteta é forçado a se isolar, enquanto a equipe se prepara para enfrentar o atual campeão da Premier League, o Man City.","air_date":"2022-08-11","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/oecu5gBd1SRGh5GZktklnNbHTgU.jpg","vote_average":9},"5":{"name":"A SAÍDA","overview":"Janeiro traz a janela de transferências, e Mikel Arteta tem a chance de reconstruir seu elenco. O Arsenal continua sua busca por títulos, competindo na FA e na Copa Carabao, além de ainda lutar pelo top 4. Enquanto isso, as perguntas sobre o futuro de Aubameyang continuam dominando a mídia, e o clube deve tomar uma decisão sobre o que fazer com seu ex-capitão .","air_date":"2022-08-11","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/2VUDMmUJXYIrh64lmodGDxLfu41.jpg","vote_average":9},"6":{"name":"SUPER MIK ARTETA","overview":"Após a saída de Aubameyang e uma janela de transferências tranquila, Mikel Arteta sente a pressão de fãs e críticos. Em casa, sua esposa e família refletem sobre seu trabalho difícil. Em campo, a equipe busca manter vivo o sonho de uma competição europeia. O zagueiro Ben White luta pelo respeito dos torcedores, e mais um jogo difícil contra o Liverpool ameaça atrapalhar o embalo do time.","air_date":"2022-08-11","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/5WFWMvOeo5MemHL44lmJBGiMpAd.jpg","vote_average":9},"7":{"name":"UMA EPIFANIA","overview":"O Arsenal sofre uma série de derrotas e luta para voltar à forma, colocando em risco seu lugar no top 4. Ao perder jogadores importantes por conta de lesões, Mikel Arteta recorre aos mais inexperientes para trazer de volta o embalo ao elenco. Ele convoca o meio-campista Mohamed Elneny e o atacante Eddie Nketiah, que se juntam ao time titular para disputar o top 4 com Chelsea e Manchester United.","air_date":"2022-08-18","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/iQlo3T2A8IPcp0ro3K9ihgGp1Gd.jpg","vote_average":9},"8":{"name":"NORTH LONDON PARA SEMPRE","overview":"À medida que a temporada chega a um fim dramático, o Arsenal encontra seu amargo rival do norte de Londres, o Tottenham Hotspur, em busca de uma vaga na Liga dos Campeões. Enquanto se preparam para as partidas finais e com tudo em jogo, a equipe pode estar à altura do desafio, ou será demais para o jovem elenco?","air_date":"2022-08-18","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/gd8CNc8ftMzKE5Y6YJGOXvZa7X4.jpg","vote_average":9}}}}},
