"224333":{"id":"224333","name":"Mordida de Amor","slug":"mordida-de-amor","original_title":"Tooth Pari: When Love Bites","overview":"Na Índia, uma vampira com um dente quebrado se apaixona por um dentista tímido, mas forças humanas e místicas ameaçam atrapalhar essa união.","first_air_date":"2023-04-20","episode_run_time":0,"vote_average":6.1,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Pratim D. Gupta"],"production_companies":["Endemol Shine India"],"genres":["Comédia","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/2JTjGgfKqLsjcQFb49lZUPvmIqp.jpg","poster_path":"https://image.tmdb.org/t/p/original/aZIV0NIwDoa0vIfBW29zsmPderU.jpg","cast":["Tanya Maniktala","Shantanu Maheshwari","Saswata Chatterjee","Tillotama Shome","Revathi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/aZIV0NIwDoa0vIfBW29zsmPderU.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/aZIV0NIwDoa0vIfBW29zsmPderU.jpg","air_date":"2023-04-20","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Upar e Neeche","overview":"Ao atacar uma presa, Rumi quebra um dente e acaba conhecendo o tímido dentista Roy. Um policial rebelde chamado Kartik investiga um caso misterioso.","air_date":"2023-04-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/uUpFF59ISEEEB4z1CBEz9J83KhM.jpg","vote_average":0},"2":{"name":"Cutmundus","overview":"O sangue raro de Roy desperta o interesse do clã de Rumi, e Sreela vai atrás dele. O caso de Kartik chama a atenção de um grupo secreto de caçadores de vampiros.","air_date":"2023-04-20","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/rJj6onL3lVZhmnkCM2U0zFm6MbS.jpg","vote_average":0},"3":{"name":"O clima não está bom","overview":"Quando uma vampira é morta, Ora proíbe o contato com o mundo dos humanos. Decidida a se vingar, Rumi busca uma ajuda improvável.","air_date":"2023-04-20","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/w3g9k5tp8D1vnt2b7WWTVdwoSFd.jpg","vote_average":0},"4":{"name":"Testes","overview":"Badshah é levado para o mundo subterrâneo. Luna Luka faz Kartik descobrir o passado de seu pai. Roy começa a suspeitar da verdadeira natureza de Rumi.","air_date":"2023-04-20","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/agXJSk8yfiEpSa0sN4jBK9atoUl.jpg","vote_average":0},"5":{"name":"Monstro","overview":"Roy luta contra seus sentimentos por Rumi. Enquanto os Cutmundus planejam descobrir os segredos dos vampiros, Rumi relembra seu passado de luto, amor e perdas.","air_date":"2023-04-20","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/w0xiijJl3Ogd2q30xIrBtTsuxUz.jpg","vote_average":0},"6":{"name":"Sacrificar um para salvar todos","overview":"Após a morte de um integrante dos Cutmundus, Luna busca vingança. Acreditando que Roy é um vampiro, Kartik recorre à chantagem.","air_date":"2023-04-20","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/uXzyEOZJdjGyq0E6vQwpA9fsRxr.jpg","vote_average":0},"7":{"name":"Apresentando os pais","overview":"Depois que um jantar na casa de Roy se transforma em uma noite de bebedeira, ele e Rumi ficam mais íntimos. A revelação de Badshah coloca Rumi em perigo.","air_date":"2023-04-20","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/xigxnv5CWEgvPzW9U5erlJw393w.jpg","vote_average":0},"8":{"name":"Número 30","overview":"Rumi enfrenta uma escolha difícil: ir atrás de Luna ou perder Roy para sempre. Uma pessoa do passado de Luna reaparece em sua vida.","air_date":"2023-04-20","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/yJNakUcyCS7GkFIwzThnmtGleXJ.jpg","vote_average":0}}}}},
"272463":{"id":"272463","name":"Volta Priscila","slug":"volta-priscila","original_title":"Volta Priscila","overview":"Em 2004, o Brasil é abalado pelo desaparecimento de Priscila, irmã do campeão mundial de MMA Vitor Belfort. A polícia corre contra o tempo para chegar à solução do caso, mas, 20 anos depois, o que resta são mais perguntas do que respostas.","first_air_date":"2024-09-25","episode_run_time":0,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":4,"created_by":["Eduardo Rajabally"],"production_companies":["Pródigo Filmes"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/sUfvNWZ9SpWJ0T52ulW9lS87dAA.jpg","poster_path":"https://image.tmdb.org/t/p/original/za3rDKjsuBdVhWqC7HA8itjKnNH.jpg","cast":["Priscila Belfort","Jovita Belfort","Vitor Belfort","Joana Prado","José Marcos Belfort"],"trailer":"ofWVmwT0_34","seasons":{"1":{"name":"Season 1","poster_path":"https://image.tmdb.org/t/p/original/za3rDKjsuBdVhWqC7HA8itjKnNH.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/za3rDKjsuBdVhWqC7HA8itjKnNH.jpg","air_date":"2024-09-25","episode_count":4,"overview":"N/A","vote_average":6.8,"episodes":{"1":{"name":"Um Dia Sem Fim","overview":"Irmã de Vitor Belfort some sem deixar vestígios, dando início a uma histórica busca policial.","air_date":"2024-09-25","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/nGA7Brl26QrEQ7FUywzQzssm85j.jpg","vote_average":7},"2":{"name":"A Pior Mentira do Mundo","overview":"Uma confissão inicia uma caçada histórica da polícia, causa mortes e desvia a atenção de todos.","air_date":"2024-09-25","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/2wUd4tPQKZT4hn481l8QL2NAtCy.jpg","vote_average":7},"3":{"name":"Costurando o Passado","overview":"A personalidade melancólica de Priscila suscita suspeitas indesejavelmente íntimas.","air_date":"2024-09-25","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/3v9Dl2RWKVkc8tbUTCmHD0uCfDK.jpg","vote_average":6.5},"4":{"name":"Alguém Sabe","overview":"Na busca da verdade, cada memória obscura instiga desconfianças de familiares e amigos de Priscila.","air_date":"2024-09-25","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/rBP9s3lZOEvXVw2rGn4DgQvNf8f.jpg","vote_average":6.5}}}}},
