"241168":{"id":"241168","name":"Investidos: O Jogo da Desconfiança","slug":"investidos-o-jogo-da-desconfianca","original_title":"The Trust","overview":"Neste reality, os participantes competem por um prêmio de 250 mil dólares. Será que eles vão dividir ou um vai tentar sabotar o outro para ficar com tudo?","first_air_date":"2024-01-10","episode_run_time":0,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":[],"production_companies":["Grandma's House Entertainment","Lighthearted Entertainment"],"genres":["Reality"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/nB39qy7oGAIEN8dQkwO1PN4WC4g.jpg","poster_path":"https://image.tmdb.org/t/p/original/bOp19lVE5wVoicuCeJfISr0Fvq2.jpg","cast":["Brooke Baldwin"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qjZC5hVRMpOHgiQjlgGk6GL0tdQ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qjZC5hVRMpOHgiQjlgGk6GL0tdQ.jpg","air_date":"2024-01-10","episode_count":8,"overview":"Neste reality, os participantes competem por um prêmio de 250 mil dólares. Será que eles vão dividir ou um vai tentar sabotar o outro para ficar com tudo?","vote_average":7,"episodes":{"1":{"name":"Casa de mentiras","overview":"Os competidores chegam a uma mansão à beira de um penhasco, e o prêmio de 250 mil dólares é repartido. A confiança é essencial para vencer, mas a trama logo se complica.","air_date":"2024-01-10","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/q8Tb8JKVaXYILlZRbSd6gYz5nMJ.jpg","vote_average":7},"2":{"name":"Por que todos estão tão emotivos?","overview":"Após os eventos tumultuados da primeira Cerimônia de Confiança, o grupo começa a se abrir. Um teste acaba transformando uma pessoa em um alvo.","air_date":"2024-01-10","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/A9zyYydcMZMzVkujepWxVjACgfH.jpg","vote_average":7},"3":{"name":"Isso muda tudo...","overview":"Um participante tenta remediar a situação e recebe a chance de resolver os conflitos. Uma aliança sólida esmorece depois que um dos jogador faz uma ameaça.","air_date":"2024-01-10","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/8oGN1ega7YkOjYi6rebtyt0uHNB.jpg","vote_average":7},"4":{"name":"Não vendo minha integridade","overview":"Uma Cerimônia de Confiança instigante dá aos jogadores a chance de aumentar seus ganhos. Em um jantar chique, um grande segredo e uma oferta inesperada vêm à tona.","air_date":"2024-01-10","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/lVnkUNr3uH1NGhuE0otcMT3Yh0y.jpg","vote_average":7},"5":{"name":"O egoísmo é relativo","overview":"Antes da próxima votação, um jogador recebe uma proposta tentadora de milhares de dólares. Uma prova baseada em mentiras deixa o grupo tenso.","air_date":"2024-01-17","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/4N6gUU09UKTGBZX4njflZL5Q4qQ.jpg","vote_average":7},"6":{"name":"Uma cobra entre nós","overview":"Um participante tenta desesperadamente evitar a eliminação, outro tem sua lealdade questionada. O Cofre faz uma oferta inédita.","air_date":"2024-01-17","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/wvjGlC7CnJX8OfCrpqglYB5tNLk.jpg","vote_average":0},"7":{"name":"A cobra está se agitando","overview":"Um jogador é eliminado e outro fica se sentindo isolado. Traições abalam a casa, e alianças que pareciam fortes começam a se desestabilizar.","air_date":"2024-01-17","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/7JJK61RYD54h6ALjk6ozniq2fr6.jpg","vote_average":0},"8":{"name":"Fim da jornada","overview":"Com a proximidade da Cerimônia de Confiança, uma verdade chocante vem à tona e surge uma proposta muito tentadora. Quem levará o prêmio e qual será o valor final?","air_date":"2024-01-24","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/3hbNbWmNVgH7GMRPyeIYgIyWvRh.jpg","vote_average":0}}}}},
